                            <h1 class="heading-style-h1 color-inherit">
                                <div class="hero_heading-block is-year"><span class="date_heading-top">2015</span></div>
                            </h1>
                            <div class="text-style-allcaps">
                                <div class="date_heading-block">
                                    <div class="date_heading-bottom text-size-medium">Hi-Tec athlete Nick Matthew gets an OBE</div>
                                </div>
                            </div>
                        </div>
                        <div data-w-id="74f063da-9e1f-b171-1522-3e3843a67a8b" class="image_title content">
                            <div class="text-size-medium">Nick Matthews, the most successful English squash player of
                                all time, was also a sponsored Hi-Tec athlete. In 2014, after carrying the England flag
                                at the Opening Ceremony for the Commonwealth Games Nick was awarded with an OBE a year
                                later.
                            </div>
